    false,nt"url": null,nt"notes": "This annual narrative report for Johnston
    Atoll NWR outlines Refuge accomplishments during the 1992 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. The report
    includes a planning section which discusses the master plan, the management plan,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, volunteer programs,
    and funding is given. Habitat management is also covered; subjects include marine
    habitats and pest control. The wildlife section of the report discusses endangered
    and threatened species, shorebirds, marine mammals, fisheries resources, animal
    control, and marking and banding. The public uses of the Refuge described in this
    report include interpretive programs, fishing, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about equipment
    replacement and communication systems.",nt"license_title": "License Not Specified",nt"extras":
